css:
@-moz-document domain("ec2-54-202-122-98.us-west-2.compute.amazonaws.com"), domain("vidbitfuture.co") {
body, .container, .col-md-12, .element.style {
    background-image: url("http://i.imgur.com/7Qjyv6y.png");
    color: #fff;
}	
.element.style {
    background-image: url("http://i.imgur.com/7Qjyv6y.png");
}
#col-md-7, #form-group, .col-md-12 {
	color: #171717;
}
.navbar-default {
    border-color: #171717;
    background-color: #171717;
	background-image: url("http://i.imgur.com/L0FDQdl.png");
    color: #fff;
}
.navbar-default:hover, .user_vote_result {
    border-color: #000000;
    background-color: #ffffff;
    color: #000000;
}
.navbar-default .navbar-nav>li>a {
    color: #fff;
}
.navbar-default .navbar-nav>li>a:hover {
    color: #fff;
}
.panel-default {
    border-color: #000;
}
.panel {
    background-color: #E2E2E2;
    box-shadow: 3px 3px 5px #888888;
}
.list-group-item {
    position: relative;
    display: block;
    padding: 10px 15px;
    margin-bottom: -1px;
    background-color: #E3E3E3;
    border: 1px solid #636363;
	color: #171717;
}
.thumbnail {
    background-color: #ffffff;
}
.panel-default > .panel-heading {
    background-image: linear-gradient(to bottom, #565656 0px, #333333 100%) !important;
    color: #333;
    background-color: #000000;
    border-color: #676767;
}
.panel-title {
    margin-top: 0;
    margin-bottom: 0;
    font-size: 16px;
    color: #fff;
}
.nav-tabs>li>a {
    border-color: #383838 #353535 #9a9a9a #1b1b1b;
}
.view-video-desc {
    color: #ffffff;
}
.btn-collapse-expand {
    background-color: #3a214e;
}
.btn-default {
    background-image: linear-gradient(to bottom, #FAFAFA 0, #DEDEDE 100%);
    color: #5D5D5D;
    border-color: #CCCCCC;
    text-shadow: 0 1px 0 rgba(255, 255, 255, 0);
}
.btn-default:hover {
    background-color: #DEDEDE;
    border-color: #CCCCCC;
    color: #5D5D5D;
    text-shadow: 0 1px 0 rgba(255, 255, 255, 0);
}
.watch-view-count {
    color: #fff;
}
.list-group-item.disabled,
.list-group-item.disabled:focus,
.list-group-item.disabled:hover {
    border-color: #000000;
    background-image: -webkit-gradient(linear, left top, left bottom, from(#565656), to(#333333));
    color: #fff;
}
.well {
    background-color: #E2E2E2;
}
.btn-primary,
.btn-primary:focus,
.btn-primary:active,
.btn-primary:hover {
    background-color: #e6e6e6;
	color: #7d7d7d;
	background-image: linear-gradient(to bottom,#FAFAFA 0,#DEDEDE 100%);
}
.user-page {
	background-image: linear-gradient(to bottom, #565656 0px, #333333 100%);
}
.panel.panel-default.clearfix {
	background-color: #333333;
}
.panel.panel-default.well, .userinfo {
	color: #fff;
}
.panel-body, .text-justify.view-video-desc, h2, h3, .watch-view-count.text-right, .col-md-3, .panel-heading, .media-body, .list-group, .list-group-item, .a.list-group-item, .col-md-6.row, .col-md-8, .col-md-9  {
	color: #171717;
}
.a.list-group-item {
    color: #171717;
}
.btn-collapse-expand.text-center {
	background-color: #E2E2E2;
}
#userinfo, .col-md-7 {
	color: #fff;
}
#upload, .table>thead>tr>th, #mail-detail, #mail-list, #mail-body-57, #col-md-8, .panel-title>h3, .row.row-offcanvas.row-offcanvas-left {
	color: #171717;
}
